import React from 'react';
import classes from './CreateButton.module.css';

const CreateButton = ({children, ...props}) => {
    return (
        <button

            {...props} className={classes.custom-btn + ' ' +  classes.btn-6}>
            {children}
        </button>
    );
};

export default CreateButton;

